(34, 75, 0, 12, '<div class=\"product-single__description rte\">\r\n<p>OFFICIAL HEAD IN THE CLOUDS MERCHANDISE.</p>\r\n<p> </p>\r\n<p>PLEASE ALLOW 2-4 WEEKS FOR SHIPPING.</p>\r\n</div>'),
