(37, 75, 0, 13, '<p>Sở hữu sức mạnh hiệu năng đột phá của dòng laptop CPU thế hệ 12 và card màn hình rời NVIDIA cùng thiết kế là sự cộng hưởng của chiếc máy tính bảng và chiếc laptop gaming, laptop Asus Gaming ROG Flow Z13 GZ301Z (LD110W) sẵn sàng chinh phục mọi đấu trường ảo cùng bạn. • Mang trong mình CPU Intel Core i7 Alder Lake có sức mạnh vượt trội kết hợp cùng card màn hình rời NVIDIA RTX 3050 4 GB giải quyết mọi khó khăn trong thiết kế đồ hoạ Adobe cũng như chơi tốt các tựa game đình đám: GTA V, CS:GO, Cyberpunk 2077,... • Laptop Asus sở hữu RAM 16 GB đem lại trải nghiệm đa nhiệm mượt mà các tác vụ kể cả đồng thời chiến game và nghe nhạc nhưng không gặp phải tình trạng giật lag. SSD 512 GB cho tốc độ truy xuất dữ liệu, khởi động máy tính cực nhanh chóng.</p>'),
(38, 76, 0, 13, '<p>Sở hữu sức mạnh hiệu năng đột phá của dòng laptop CPU thế hệ 12 và card màn hình rời NVIDIA cùng thiết kế là sự cộng hưởng của chiếc máy tính bảng và chiếc laptop gaming, laptop Asus Gaming ROG Flow Z13 GZ301Z (LD110W) sẵn sàng chinh phục mọi đấu trường ảo cùng bạn. • Mang trong mình CPU Intel Core i7 Alder Lake có sức mạnh vượt trội kết hợp cùng card màn hình rời NVIDIA RTX 3050 4 GB giải quyết mọi khó khăn trong thiết kế đồ hoạ Adobe cũng như chơi tốt các tựa game đình đám: GTA V, CS:GO, Cyberpunk 2077,... • Laptop Asus sở hữu RAM 16 GB đem lại trải nghiệm đa nhiệm mượt mà các tác vụ kể cả đồng thời chiến game và nghe nhạc nhưng không gặp phải tình trạng giật lag. SSD 512 GB cho tốc độ truy xuất dữ liệu, khởi động máy tính cực nhanh chóng.</p>'),
(39, 85, 0, 13, 'HITC OFFICIAL FESTIVAL TEE'),
(40, 75, 0, 14, '<blockquote>RESTOCK!</blockquote>\r\n<blockquote>PLEASE LIMIT TO TO 4 MUSIC PRODUCTS PER CART- MORE THAN 4 VINYL PER ORDER MAY RESULT IN ORDER CANCELLATION</blockquote>\r\n<blockquote>\r\n<div>TRACK LIST:</div>\r\n<div>1. La Cienega - 88rising, Joji &amp; NIKI</div>\r\n<div>2. Red Rubies - 88rising, Rich Brian, Yung Bans, Yung Pinch, Higher Brothers &amp; Don Krez</div>\r\n<div>3. Swimming Pool - 88rising, Higher Brothers, 03 Greedo</div>\r\n<div>4. Peach Jam - 88rising, Joji &amp; BlocBoy JB</div>\r\n<div>5. Midsummer Madness - 88rising, Joji, Rich Brian, Higher Brothers &amp; AUGUST 08</div>\r\n<div>6. Plans (feat. Vory) - 88rising &amp; NIKI </div>\r\n<div>7. History - 88rising &amp; Rich Brian </div>\r\n<div>8 Lover Boy 88 - 88rising, Phum Viphurit &amp; Higher Brothers </div>\r\n<div>9. Poolside Manor - 88rising, AUGUST 08 &amp; NIKI</div>\r\n<div>10. Beam (feat. Playboi Carti) - 88rising &amp; Rich Brian</div>\r\n<div>11. Let it Go - 88rising, Higher Brothers &amp; BlocBoy JB</div>\r\n<div>12. Disrespectin - 88rising, Rich Brian, Higher Brothers &amp; AUGUST 08</div>\r\n<div>13. Warpaint - 88rising &amp; NIKI</div>\r\n<div>14. I Want In - 88rising, AUGUST 08 &amp; NIKI</div>\r\n<div>15. Japan 88 - 88rising, Famous Dex, Keith Ape &amp; Verbal</div>\r\n<div>16. Nothing Wrong (feat. GoldLink) - 88rising, Higher Brothers, Harikiri &amp; GoldLink</div>\r\n<div>17. Head In The Clouds - 88rising &amp; Joji</div>\r\n</blockquote>'),
(41, 76, 0, 14, '<div>LIMITED TO 4 MUSIC PRODUCTS PER CART- MORE THAN 4 PER ORDER MAY RESULT IN ORDER CANCELLATION.</div>\r\n<div> </div>\r\n<div>THIS ITEM IS NON-REFUNDABLE AND CUSTOMERS WILL NOT BE ABLE TO RETURN THIS PRODUCT UNLESS THERE IS PROOF OF DAMAGE UPON ORDER ARRIVAL.</div>\r\n<div> </div>\r\n<div>TO SEE IF YOUR RETURN IS ELLIGIBLE, PLEASE CONTACT CS@88NIGHTMARKET.COM FOR MORE INFORMATION.</div>'),
(42, 85, 0, 14, '88rising - Head In The Clouds (2X LP Vinyl) - RESTOCK'),
(43, 75, 0, 15, '<div class=\"product-single__description rte\">\r\n<p>Vandy The Pink x 88rising</p>\r\n<p>JUMBO SIZED LUNAR NEW YEARS LIMITED EDITION LUCKY CAT PLUSH.</p>\r\n<p>ONE SIZE TO RULE THEM ALL.</p>\r\n<p>Dimensions 2\'0 x 2\'0 (2 FT x 2 FT)</p>\r\n</div>'),
(44, 76, 0, 15, '<p>Vandy The Pink x 88rising</p>'),
(45, 85, 0, 15, 'Jumbo Vandy88 LNY Limited Edition Lucky Cat'),
(46, 75, 0, 16, '<p>Dandy Farmer x 88rising Bonsai Tree</p>\r\n<p>Jade Tree native to southern Africa.</p>\r\n<p>Variegated Baby Jade <em><strong>Portulacaria a. variegata</strong></em></p>\r\n<p>Care directions:</p>\r\n<p><em>Keep in location with full or partial sunlight. To water, submerge pot in water up to the rim for 15 minutes. Submerge once every 8-10 days and avoid overwatering. Good indicator of when to water is when fleshy leaves start to soften. Recommended good air circulation and a trim twice a year for optimum shape.</em></p>\r\n<p>Domestic shipping only (excluding Alaska and Hawaii).</p>\r\n<p> </p>\r\n<p>Shipping cost covers express shipping (1-3 days) and will add heat packs in the winter to arrive to you in the best possible condition.</p>'),
(47, 76, 0, 16, '<p>Dandy Farmer x 88rising Bonsai Tree</p>\r\n<p>Jade Tree native to southern Africa.</p>'),
(48, 85, 0, 16, 'Dandy Bonsai Tree'),
(49, 75, 0, 17, '<p>Laptop HP Gaming VICTUS 16 d0198TX (4R0U0PA) là chiếc laptop gaming mạnh mẽ với vẻ ngoài cá tính, sẵn sàng tác chiến cùng bạn trên mọi chiến trường ảo. • CPU Intel Core i7 Tiger Lake 11800H vận hành trơn tru nhu cầu học tập, văn phòng. Card rời NVIDIA GeForce RTX3050Ti, 4 GB xử lý ổn định các tác vụ đồ hoạ, biên tập video, chiến các tựa game hấp dẫn. • Không gian hiển thị rộng lớn với góc nhìn rộng lên đến 178 độ trên laptop HP VICTUS nhờ kích thước màn hình 16.1 inch cùng tấm nền IPS tiên tiến. Độ sáng 250 nits và công nghệ Anti Glare hạn chế chống chói, loá ở nơi có ánh sáng mạnh. • Tần số quét 144 Hz giúp hình ảnh chuyển động vô cùng chân thực, hạn chế mờ hình hay xé hình.</p>'),
