(464, 76, 0, 155, '<p>Laptop HP Gaming VICTUS 16 d0198TX (4R0U0PA) là chiếc laptop gaming mạnh mẽ với vẻ ngoài cá tính, sẵn sàng tác chiến cùng bạn trên mọi chiến trường ảo. • CPU Intel Core i7 Tiger Lake 11800H vận hành trơn tru nhu cầu học tập, văn phòng. Card rời NVIDIA GeForce RTX3050Ti, 4 GB xử lý ổn định các tác vụ đồ hoạ, biên tập video, chiến các tựa game hấp dẫn. • Không gian hiển thị rộng lớn với góc nhìn rộng lên đến 178 độ trên laptop HP VICTUS nhờ kích thước màn hình 16.1 inch cùng tấm nền IPS tiên tiến. Độ sáng 250 nits và công nghệ Anti Glare hạn chế chống chói, loá ở nơi có ánh sáng mạnh. • Tần số quét 144 Hz giúp hình ảnh chuyển động vô cùng chân thực, hạn chế mờ hình hay xé hình.</p>'),
