(490, 75, 0, 164, '<p>Đại diện cho thế hệ mới đầy mạnh mẽ, Acer Nitro 5 Gaming AN515 57 720A i7 (NH.QEQSV.004) sở hữu cấu hình vượt trội đến từ CPU Intel Gen 11 tân tiến đầy mạnh mẽ, cùng thiết kế cá tính, là người cộng sự lý tưởng trên mọi chiến trường ảo. Mang đến khả năng xử lý mọi việc tuyệt hảo Acer Nitro 5 được trang bị bộ vi xử lý Intel Core i7 Tiger Lake 11800H với 8 nhân 16 luồng sở hữu tốc độ cơ bản 2.30 GHz và đạt tối đa lên đến 4.6 GHz nhờ Turbo Boost, hỗ trợ bạn xử lý mọi công việc văn phòng một cách trơn tru cùng Word, Excel,... hay chiến những tựa game thịnh hành đầy kịch tính một cách mượt mà.</p>'),
